import React from "react";
import PostItem from "./PostItem";

const PostList = ({ posts, titel, remove }) => {

    return (
        <div>
            <h1 style={{ textAlign: 'center' }}>
                {titel}
            </h1>

            {posts.map((post, index) => <PostItem number={index + 1} post={post} key={post.id} />)}
        </div>
    )
}

export default PostList;
